b259d095-7dd5-46d6-97d8-d75ccd95a0f8.text:
创建第一个 TypeScript 文件 首先安装 TypeScript npm install -g typescript 安装后看是否成功 tsc --version 我安装后出现了以下问题：

这种情况只需要以管理员的身份打开命令行运行以下命令： set-ExecutionPolicy RemoteSigned 创建第一个 ts 文件Hello.ts function sayHello(name: String) {
  console.log(`Hello ${name}`);
}
let person = 'Alan';
sayHello(person); 我们发现 ts 代码和普通的 js 代码在 sayHello 函数的参数上有所不同。
sayHello(name: String)
大致的意思就是 sayHello 传入一个名为 name 的参数，该参数的类型必须是 String ，不然无法通过 ts 的编译。
代码写好后用 tsc 编译上面的 Hello.ts 文件 tsc Hello.ts

5afda6f6-6667-4d00-aed6-536980d4048c.text:
function sayHello(name) {
  console.log('Hello ' + name);
}
var person = 'Alan';
sayHello(person); 如果把Hello.ts文件改写一下 function sayHello(name: String) {
  const text = 3 + name;
  console.log(`Hello ${name}`);
}
let person = 123;
sayHello(person); 再次编译发现会报错但是仍然能生成 js 文件： 上面错误的具体意思是 由于声明了函数形参 name 为静态类型 string ，而在调用时传入得是 number 类型 123 ，与前面的 string 不符。
