4c118271-0bab-4ec7-a991-0c5048fbf870.text:
类型断言 可以自己指定一个值的类型
格式如下
<类型>值
值 as 类型 interface student {
  isStudent: boolean;
  education: number;
}
interface worker {
  isStudent: boolean;
  seniority: number;
}
function Recruit(candidate: worker | student): void {
  if (candidate.isStudent) {
    console.log(`your education is ${(candidate as student).education}`);
  } else {
    console.log(`your seniority is ${(candidate as worker).seniority}`);
  }
}

const a: student = { isStudent: true, education: 4 };
const b: worker = { isStudent: false, seniority: 2 };
Recruit(a);
Recruit(b); 由于 candidate 使用了联合类型，所以 ts 无法判断 candidate 究竟是属于 student 还是 worker ，所以要使用类型断言来显式告诉 ts。 当然还有其他方式来实现

fc65773a-7dfc-45c8-ad2c-7fa2481f8af1.text:
interface student {
  isStudent: boolean;
  education: number;
}
interface worker {
  isStudent: boolean;
  seniority: number;
}
function Recruit(candidate: worker | student): void {
  'education' in candidate && console.log(`your education is ${candidate.education}`);
  'seniority' in candidate && console.log(`your seniority is ${candidate.seniority}`);
}

const a: student = { isStudent: true, education: 4 };
const b: worker = { isStudent: false, seniority: 2 };
Recruit(a);
Recruit(b);

