这个例子需要传入 work 的参数必须是一个带有 name(string)的对象，可以理解为我要招聘一个有名字的员工，没有名字的都不需要。当然我们的 person1 中还多了一个age属性，这并不会报错。可是当我们直接传递参数时是会出错的。 work({ name: 'Alan', age: 21 });

